import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { NavLink } from 'react-router-dom';

/** Import assets */
import './sidebar.css';

class Sidebar extends React.Component {
  render() {
    const props = this.props;

    return (
      <Menu {...props} menuClassName="shadow-sm">
        <ul className="sidebar-menu-container card p-2 list-group list-group-flush text-center d-flex flex-column align-items-start shadow-sm">
            <div className = "itemP">News</div>
            <div className = "itemC">News1</div>
            <div className = "itemC">News2</div>
            <div className = "itemC">News3</div>
            <div className = "itemC">News4</div>
            <div className = "itemC">News5</div>
            <div className = "itemC">News6</div>

            <div className = "itemP">Tips</div>
            <div className = "itemC">Tip1</div>
            <div className = "itemC">Tip2</div>
            <div className = "itemC">Tip3</div>
            <div className = "itemC">Tip4</div>
            <div className = "itemC">Tip5</div>
            <div className = "itemC">Tip6</div>
        </ul>
      </Menu>
    );
  }
}

export default Sidebar;
